    </p-radioButton>
  `,
  host: {
    class: 'freud-radio-button',
    '[class.freud-bgcolor]': `bgColor`,
  },
  providers: [
    {
      provide: NG_VALUE_ACCESSOR,
      useExisting: forwardRef(() => FreudRadioButtonComponent),
      multi: true
    }
